import "../style/collection.css";

function Collection() {
	return (
		<div id='collection_main_container'>
			<div className='collection_card'>
				men
				<img id='mens_collection' />
			</div>
			<div className='collection_card'>
				women
				<img id='womens_collection' />
			</div>
		</div>
	);
}

export default Collection;
